import React, { useEffect, useState } from "react";
import axios from "axios";
import dayjs from "dayjs";
import TopBar from "../components/TopBar";
import { FaSearch } from "react-icons/fa";

export default function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [orgs, setOrgs] = useState([]);
  const [dateFilter, setDateFilter] = useState("");
  const [orgFilter, setOrgFilter] = useState("");
  const [actionFilter, setActionFilter] = useState("");
  const [noShowFilter, setNoShowFilter] = useState("");
  const [search, setSearch] = useState("");

  // Pagination
  const [currentPage, setCurrentPage] = useState(1);
  const logsPerPage = 10;

  useEffect(() => {
    fetchLogs();
    fetchOrgs();
  }, []);

  const fetchLogs = async () => {
    try {
      const res = await axios.get("/api/organizations/all-logs");
      const flattened = [];
      res.data.forEach((org) => {
        org.reservations.forEach((r) =>
          flattened.push({ ...r, org: org.name, timestamp: r.timestamp || r.checkInTime || r.checkOutTime || r.rangeStart || new Date() })
        );
      });
      setLogs(flattened);
    } catch (err) {
      console.error("Error fetching logs:", err);
    }
  };

  const fetchOrgs = async () => {
    try {
      const res = await axios.get("/api/organizations");
      setOrgs(res.data);
    } catch (err) {
      console.error("Error fetching orgs:", err);
    }
  };

  const formatTime = (ts) => (ts ? dayjs(ts).format("h:mm A") : "-");
  const formatDate = (ts) => (ts ? dayjs(ts).format("MM/DD/YYYY") : "-");
  const formatTable = (table) => {
    if (table?.barcode) return `Yes\n1 Table (${table.barcode})`;
    return "No";
  };
  const formatChairs = (chairs) => {
    if (!chairs?.length) return "No";
    return `Yes\n${chairs.length} Chair${chairs.length > 1 ? "s" : ""} (${chairs.map((c) => c.barcode).join(", ")})`;
  };

  const filteredLogs = logs
    .filter((log) => {
      if (dateFilter && formatDate(log.timestamp) !== dayjs(dateFilter).format("MM/DD/YYYY")) return false;
      if (orgFilter && orgFilter !== "All Organizations" && log.org !== orgFilter) return false;
      if (actionFilter && actionFilter !== "All Actions" && log.action !== actionFilter) return false;
      if (noShowFilter === "Yes" && !log.noShow) return false;
      if (noShowFilter === "No" && log.noShow) return false;
      if (search) {
        const s = search.toLowerCase();
        return (
          log.clientName?.toLowerCase().includes(s) ||
          log.eventNumber?.toLowerCase().includes(s) ||
          log.user?.toLowerCase().includes(s) ||
          log.tablingSpot?.toLowerCase().includes(s) ||
          log.notes?.toLowerCase().includes(s)
        );
      }
      return true;
    })
    .sort((a, b) => new Date(b.timestamp) - new Date(a.timestamp));

  const totalPages = Math.ceil(filteredLogs.length / logsPerPage);
  const pageLogs = filteredLogs.slice((currentPage - 1) * logsPerPage, currentPage * logsPerPage);

  const handlePageChange = (page) => {
    if (page >= 1 && page <= totalPages) setCurrentPage(page);
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <TopBar />
      <div className="p-6 max-w-7xl mx-auto">
        <h2 className="text-3xl font-bold mb-6 text-asuGold text-center">Tabling Logs</h2>

        {/* Filters */}
        <div className="flex flex-wrap gap-4 justify-center mb-4">
          <input type="date" value={dateFilter} onChange={(e) => setDateFilter(e.target.value)} className="bg-gray-800 border border-gray-600 p-2 rounded" />
          <select value={orgFilter} onChange={(e) => setOrgFilter(e.target.value)} className="bg-gray-800 border border-gray-600 p-2 rounded">
            <option>All Organizations</option>
            {orgs.map((org) => (
              <option key={org}>{org}</option>
            ))}
          </select>
          <select value={actionFilter} onChange={(e) => setActionFilter(e.target.value)} className="bg-gray-800 border border-gray-600 p-2 rounded">
            <option>All Actions</option>
            <option value="check_in">Check In</option>
            <option value="check_out">Check Out</option>
            <option value="no_show">No Show</option>
          </select>
          <select value={noShowFilter} onChange={(e) => setNoShowFilter(e.target.value)} className="bg-gray-800 border border-gray-600 p-2 rounded">
            <option value="">All</option>
            <option value="Yes">No Show</option>
            <option value="No">Not No-Show</option>
          </select>
          <div className="relative">
            <FaSearch className="absolute left-2 top-2.5 text-gray-400" />
            <input
              type="text"
              placeholder="Search client, event, spot..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="bg-gray-800 border border-gray-600 pl-8 pr-3 py-2 rounded w-64"
            />
          </div>
        </div>

        {/* Table */}
        <div className="overflow-x-auto rounded border border-gray-700">
          <table className="min-w-full text-sm">
            <thead className="bg-slate-800 text-white">
              <tr className="text-left border-b border-gray-700">
                {["Date", "Time", "User", "Org", "Client", "Event #", "Spot", "Check-In", "Check-Out", "No Show", "Tables", "Chairs", "Notes"].map((h) => (
                  <th key={h} className="px-4 py-3 border-r border-gray-700 whitespace-nowrap">
                    {h}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {pageLogs.length === 0 ? (
                <tr>
                  <td colSpan={13} className="text-center py-8 text-gray-400">
                    No tabling logs match the selected filters.
                  </td>
                </tr>
              ) : (
                pageLogs.map((log, i) => (
                  <tr key={i} className="border-t border-gray-800 hover:bg-gray-800">
                    <td className="px-4 py-2 border-r border-gray-800">{formatDate(log.timestamp)}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{formatTime(log.timestamp)}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{log.user}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{log.org}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{log.clientName || "-"}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{log.eventNumber}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{log.tablingSpot}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{formatTime(log.checkInTime)}</td>
                    <td className="px-4 py-2 border-r border-gray-800">{formatTime(log.checkOutTime)}</td>
                    <td className="px-4 py-2 border-r border-gray-800">
                      <span className={`px-2 py-1 rounded text-sm font-semibold ${log.noShow ? "bg-green-600 text-white" : "bg-red-600 text-white"}`}>
                        {log.noShow ? "Yes" : "No"}
                      </span>
                    </td>
                    <td className="px-4 py-2 border-r border-gray-800 whitespace-pre-line">{formatTable(log.table)}</td>
                    <td className="px-4 py-2 border-r border-gray-800 whitespace-pre-line">{formatChairs(log.chairs)}</td>
                    <td className="px-4 py-2">{log.notes || "-"}</td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>

        {/* Pagination Controls */}
        {totalPages > 1 && (
          <div className="mt-6 flex justify-center gap-4">
            <button onClick={() => handlePageChange(currentPage - 1)} disabled={currentPage === 1} className="px-4 py-1 rounded bg-gray-700 text-white disabled:opacity-50">
              Prev
            </button>
            <span className="text-white">{`Page ${currentPage} of ${totalPages}`}</span>
            <button onClick={() => handlePageChange(currentPage + 1)} disabled={currentPage === totalPages} className="px-4 py-1 rounded bg-gray-700 text-white disabled:opacity-50">
              Next
            </button>
          </div>
        )}
      </div>
    </div>
  );
}
